	/* get user agent */
	if(!s.eVar68)
	{
		s.eVar68 = "D=User-Agent";
	}	
	
    if (checkEvents('event4,event18,event30')) {
        if (s.getValOnce('1','event34')=='1') addEvent('event34');
        addEvent('event21');
    }

    if (checkEvents('event1,event25')) {
        if (s.getValOnce('1','event65')=='1') addEvent('event65');
         addEvent('event66');
    }

    if (checkEvents('event5')) {
         if (s.getValOnce('1','event7')=='1') addEvent('event7');
    }

