function safeGetQueryParam(param, sep, loc){
        var value = "";
        try{
            value = s.getQueryParam(param, sep, loc);
        }catch(e){
            //
        }
        return value;
}
function adjustPrefix(value) {
	return value.replace("L:", "LDN:");
}

function addEvent(evnt) {
    if (s.events===''){
        s.events=evnt;
    }else{
        s.events+=','+evnt;
    }
}

function checkEvents(evnts) {
    var etl = s.split(s.events,',');
    var etc = s.split(evnts,',');
    var i,j;

    for (i=0;i<etc.length;i++) {
        for (j=0;j<etl.length;j++) {
            if (etc[i]==etl[j]) return true;
        }
    }
    return false;
}

function classifyVeh(veh) {
    if (veh=="") return "";
    switch (veh) {
        case "LS":
        case "GS":
        case "IS":
        case "ES":
		case "GSf":
            return "Sedan"; break;
        case "ISC":
        case "SC":
            return "Convertible"; break;
        case "GX":
        case "LX":
        case "RX":
            return "Luxury Utility";
        case "GSh":
        case "RXh":
        case "HSh":
        case "LSh":
        case "CTh":
            return "Hybrid"; break;
        case "ISF":
		case "LFA":
            return "F Performance"; break;
        case "LFAR":
        case "LFS":
        case "LFX":
        case "LFC":
		case "LF-C":
		case "LF-AR":
		case "LF-X":
		case "LF-S":
		case "LF-Gh":
		case "LF-LC":
            return "Future/Concept"; break;
        default:
            return "Unknown: " + veh;
    }
}

